      <button style={styles.button} onClick={() => { /* Handle action */ }}>Gain Strength</button>
      <button style={styles.button} onClick={() => { /* Handle action */ }}>Get Flexible</button>
      <button style={styles.button} onClick={() => { /* Handle action */ }}>Meditation</button>
      <button style={styles.button} onClick={() => { /* Handle action */ }}>Sleep Well</button>
      <button style={styles.button} onClick={() => { /* Handle action */ }}>Gain Weight</button>
    </div>
  );
};
fetchNutritionData();

const styles = {
  container: {
    backgroundColor: '#FFF5EE',
    padding: '16px',
    textAlign: 'center',
  },
  title: {
    fontSize: '24px',
    fontWeight: 'bold',
    margin: '32px 0',
  },
  button: {
    width: '100%',
    padding: '10px',
    marginTop: '16px',
    fontSize: '16px',
    cursor: 'pointer',
  },
};
// Assuming you have selectedAge and selectedGender from the user's input
const selectedAge = 26;
const selectedGender = 'Male';

// Function to fetch nutrition data based on age and gender
const fetchNutritionData = async () => {
  try {
    const response = await fetch(`/api/nutrition?age=${selectedAge}&gender=${selectedGender}`);
    const data = await response.json();
    console.log('Fetched data:', data);
  } catch (error) {
    console.error('Error fetching nutrition data:', error);
  }
};

// Call this function when the user selects a goal

export default GoalActivity;
